URL = 'http://164.100.47.194/Loksabha/Legislation/billintroduce.aspx'

class GapSpider(scrapy.Spider):
    name = "parliament_bills"

    allowed_domains = ["164.100.47.194"]
    start_urls = [URL]

    def parse(self, response):
        # submit a form (first page)
        self.current_page = 1;
        self.data = {}
        self.data['ctl00$txtSearchGlobal'] = ''
        self.data['ctl00$ContentPlaceHolder1$RadioBttnhouse'] = 'both'
        self.data['ctl00$ContentPlaceHolder1$RadioBttnbilltyp'] = 'All'
        self.data['ctl00$ContentPlaceHolder1$STitle'] = ''
        self.data['ctl00$ContentPlaceHolder1$ddlMember'] = '--- Please Select ---'
        self.data['ctl00$ContentPlaceHolder1$RadioBttnmember'] = 'Current'
        self.data['ctl00$ContentPlaceHolder1$ddlMinistry'] = '--- Please Select ---'
        self.data['ctl00$ContentPlaceHolder1$ddlCategory'] = '--- Please Select ---'
        self.data['ctl00$ContentPlaceHolder1$ddlYear1'] = 'Select'
        self.data['ctl00$ContentPlaceHolder1$ddlYear2'] = 'Select'
        self.data['ctl00$ContentPlaceHolder1$btnsbmt'] = 'Submit'
        self.data['ctl00$ContentPlaceHolder1$ddlfile'] = '.pdf'
        self.data['__VIEWSTATEENCRYPTED'] = ''
        self.data['__VIEWSTATEGENERATOR'] = '66A852E9'
        self.data['__LASTFOCUS'] = ''

        self.data['__EVENTVALIDATION'] = ''
        self.data['__VIEWSTATE'] = ''
        self.data['__EVENTARGUMENT'] = ''
        self.data['__EVENTTARGET'] = ''

        return FormRequest(url=URL,
                           method='POST',
                           callback=self.parse_page,
                           formdata=self.data,
                           meta={'page': 1},
                           dont_filter=True,
                           headers=HEADERS)

    def parse_page(self, response):
        print(self.current_page)
        text_file = open(str(self.current_page)+".txt", "wb")
        text_file.write(response.body)
        text_file.close()

        self.current_page = self.current_page + 1

        text = response.body.decode()
        eventValMatchedObj = re.search(r'__EVENTVALIDATION\" value=\"[A-Za-z0-9-/+=]*', text, re.MULTILINE)
        eventVal = text[eventValMatchedObj.start()+26:eventValMatchedObj.end()]

        valueStateMatchedObj = re.search(r'__VIEWSTATE\" value=\"[A-Za-z0-9-/+=]*', text, re.MULTILINE)
        valState = text[valueStateMatchedObj.start() + 20:valueStateMatchedObj.end()]

        self.data['__EVENTARGUMENT'] = 'Page$'+ str(self.current_page)
        self.data['__EVENTVALIDATION'] = eventVal
        self.data['__VIEWSTATE'] = valState
        self.data['__EVENTTARGET'] = 'ctl00$ContentPlaceHolder1$GR1'

        return FormRequest(url=URL,
                           method='POST',
                           formdata=self.data,
                           callback=self.parse_page,
                           meta={'page': self.current_page},
                           dont_filter=True,
                           headers=HEADERS)